const Home = () => {
    return (
        <div className="d-flex justify-content-center register_head">
            <div className="container align-items-center d-flex">
                <div className="row col-md-6 offset-md-3 text-center">
                    <h1 className="pt-5 fw-bold">Explore the right plan for your business</h1>
                    <p className="lead pb-4">Choose the plan that suites you best!</p>
                </div>

                <div className="row row-cols-1 pt-5 mb-3 text-center">
                    <div className="col">
                        <div className="card mb-4 rounded-3 shadow-sm">
                            <div className="card-header py-3">

                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Home;
